import React, { useState, useEffect } from 'react';
import axios from 'axios';



function Portfolio() {
  const [projects, setProjects] = useState([]);
  const apiUrl = process.env.REACT_APP_API_URL;
  const testV=`${apiUrl}/api/projects`;
 {/*console.log("API URL:", testV); // Log the API URL*/} 



  useEffect(() => {
    axios
      .get(`${apiUrl}/api/projects`) // Use backticks and ${} for variable interpolation
      .then((response) => {
        setProjects(response.data);
      })
      .catch((error) => {
        console.error('Error retrieving projects:', error);
      });
  }, []);

  const fetchProjects = () => {
    axios.get(`${apiUrl}/api/projects`) // Use backticks and ${} for variable interpolation
      .then((response) => {
        console.log(response.data); // Log the response data
        setProjects(response.data);
      })
      .catch((error) => {
        console.error('Error retrieving projects:', error);
      });
  };


  return (
    <div className="portfolio">
      <h1>My Portfolio</h1>
      <div className="project-list">
        {projects.map((project) => (
          <div key={project.Id}>
            <h2>{project.Name}</h2>
            <p>{project.Description}</p>
            {/* Add other project details here */}
          </div>
        ))}
      </div>
    </div>
  );
}

export default Portfolio;
